import Card from './Card.js'

export default function Tours({props}){
    return(
        <div>
                <div><h2>Code-With-Love</h2></div>
                {
                        props.map((cards)=>{
                            return(<Card data = {cards}/>);
                            
                        })
              }
        </div>
    );
}
